import {pieces} from '../PieceData';


export const checkPiece = (x, y) => 
{
    console.log("x: " + x);
    console.log("y: " + y);
    for(let p of pieces) {
        console.log('p.x: ' + p.x);
        console.log('p.y: ' + p.y);
        if(x === p.x && y === p.y)
        {

            return true;
            break;

        }
        else
        {
            console.log("FALSE");
            return false;
        }
    };
}
